Thorax: S
cutal integument light brown with setae generally appearing light brown to translucent depending on angle of light, setae on anterior promontory and prescutellar area paler, acrostichal setae absent. Thoracic pleura generally not uniform in colour, with prealar area darker brown than upper and lower mesokatepisternum, upper 0.33 of mesanepimeron darker than paler beige to light brown of lower 0.66 of mesokatepisternum (
Fig. 21A
), in some specimens middle 0.25 of mesokatepisternum darker brown than rest of area (
Fig. 21B,C
); pleura devoid of scales except for small patch among setae on upper mesokatepisternum, setae present on following areas: antepronotum, a row of 6 on posterior margin of postpronotum, 3 on proepisternum, prealar knob, a few in middle and posterior margin of mesokatepisternum, and a single lower mesepimeral seta. Capitellum of halter darker than pedicel.
